import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import Carousel from 'react-bootstrap/Carousel'

import Beaufort from '../images/photography/beaufort.jpg';
import Cake from '../images/photography/Cake.jpg';
import Bridge from '../images/photography/Downtown-Bridge-yo.jpg';
import Expanse from '../images/photography/expanse.jpg';
import Fripp from '../images/photography/Fripp.jpg';
import Houses from '../images/photography/houses.jpg';
import Newpoint from '../images/photography/IMG_0140-1.jpg';
import Charles from '../images/photography/IMG_6175.JPG';
import Nature from '../images/photography/nature.jpg';
import Dock from '../images/photography/newpoint.jpg';
import Sun from '../images/photography/sunnyday.jpg';

export default class photoCarousel extends Component {
    constructor(props, context) {
        super(props, context);

        this.handleSelect = this.handleSelect.bind(this);

        this.state = {
          index: 0,
          direction: null,
        };
      }
      handleSelect(selectedIndex, e) {
        this.setState({
          index: selectedIndex,
          direction: e.direction,
        });
      }
  render () {
    const { index, direction } = this.state;
    return (
      <Carousel 
      activeIndex={index}
      direction={direction}
      onSelect={this.handleSelect}>
      <div>
          <img src={Beaufort} />
          <p className="legend">Beaufort</p>
      </div>
      <div>
          <img src={Cake} />
          <p className="legend">Cake</p>
      </div>
      <div>
          <img src={Bridge} />
          <p className="legend">Bridge</p>
      </div>
      <div>
          <img src={Expanse} />
          <p className="legend">Expanse</p>
      </div>
      <div>
          <img src={Fripp} />
          <p className="legend">Fripp</p>
      </div>
      <div>
          <img src={Houses} />
          <p className="legend">Houses</p>
      </div>
      <div>
          <img src={Newpoint} />
          <p className="legend">Newpoint</p>
      </div>
      <div>
          <img src={Charles} />
          <p className="legend">Charles</p>
      </div>
      <div>
          <img src={Nature} />
          <p className="legend">Nature</p>
      </div>
      <div>
          <img src={Dock} />
          <p className="legend">Dock</p>
      </div>
      <div>
          <img src={Sun} />
          <p className="legend">Sun</p>
      </div>
    </Carousel>
    )
  }
}
